Name>\" single page\n        Then user should be redirected to \"<Title_Name>\"\n        Then no error toasts should be displayed\n\n        Examples:\n            | Page_Name          | Title_Name              |\n            | Inventory database | INVENTORY_DATABASE_PAGE |\n            | New leads          | NEW_LEADS_PAGE          |\n\n    Scenario Outline: Verify navigating to \"<Page_Name>\" page - \"<Dropdown_Item>\" in sidebar\n        Given user is in home page\n        When user expands \"<Page_Name>\" dropdown in sidebar\n        When user clicks \"<Dropdown_Item>\" in sidebar menu\n        Then user should be redirected to \"<Title_Name>\"\n        Then no error toasts should be displayed\n\n        Examples:\n            | Page_Name                     | Dropdown_Item    | Title_Name                |\n            | Inventory management          | All              | INVENTORY_MANAGEMENT_PAGE |\n            | Spare parts inventory reports | Used spare parts | USED_SPARE_PARTS_PAGE     |","uri":"[Autoavans - E2E Test Suite]:src\/tests\/features\/home-page.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"source":{"data":"@mode:parallel\n@regression\n@buy_leads_page\nFeature: Buy Leads Page\n\n    Scenario: Verify opening buy offer link and buy leads page\n        Given user is in home page\n        When user clicks on \"Buy leads\" card in home page\n        Then user should be redirected to \"ALL_BUY_LEADS_PAGE\"\n        Then no error toasts should be displayed\n        When user clicks on active buy offer link button\n        When user switches to the new tab\n        Then user should be redirected to \"BUY_OFFER_LINK_PAGE\"","uri":"[Autoavans - E2E Test Suite]:src\/tests\/features\/buy-leads.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"source":{"data":"Feature: Login Page\n\n    Scenario: Valid Login\n        Given user navigates to login page\n        When user types username\n        When user types password\n        When user clicks on login button\n        Then user should be redirected to home page","uri":"[Autoavans - E2E Test Suite]:src\/tests\/features\/login.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"source":{"data":"@mode:serial\n@regression\n@inventory_management_page\nFeature: Inventory Management\n\n    Scenario: Verify add to inventory in Inventory Management page\n        Given user is in home page\n        When user expands \"Inventory management\" dropdown in sidebar\n        When user clicks \"All\" in sidebar menu\n        Then user should be redirected to \"INVENTORY_MANAGEMENT_PAGE\"\n        Then no error toasts should be displayed\n        When user searches data in inventory management\n            | label     | value  |\n            | company   | Kinna  |\n            | warehouse | Garage |\n        When user creates a new item in add to inventory modal\n        Then data should be displayed correctely in inventory management grid","uri":"[Autoavans - E2E Test Suite]:src\/tests\/features\/inventory-management.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"source":{"data":"@mode:serial\n@regression\n@sales_flow\nFeature: Sales Flow\n\n    @advertisement\n    @sf_function_test\n    Scenario: Verify completing seller information page and creating a lead\n        Given user searches a sales lead id in quick search\n        When user clicks on \"CREATE_LEAD_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"SELLER_INFORMATION_PAGE\"\n        When user enters all required information in seller information page\n        And user saves seller information page\n        Then no error toasts should be displayed\n\n    @advertisement\n    @sf_function_test\n    Scenario: Verify booking the vehicle\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"BOOK_INCOMING_VEHICLE_BUTTON\" in \"VEHICLE_CARD\"\n        Then user should be redirected to \"BOOK_INCOMING_VEHICLE_PAGE\"\n        When user clicks on \"SAVE_BOOKING_BUTTON\" in \"BOOK_INCOMING_VEHICLE\"\n        Then no error toasts should be displayed\n        Then the lead status should be changed to \"BOOKED LEAD\"\n\n    @advertisement\n    @sf_function_test\n    Scenario: Verify completing the mandatory checklist\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"CHECKLIST_BUTTON\" in \"VEHICLE_CARD\"\n        Then user should be redirected to \"MANDATORY_CHECKLIST_PAGE\"\n        When user completes marking mandatory checklist\n\n    @advertisement\n    @sf_function_test\n    Scenario: Verify adding vehicle to the stock\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"GENERATE_CONTRACT\" in \"VEHICLE_CARD\"\n        Then user signs the contract and bring the vehicle in stock\n        Then the lead status should be changed to \"IN STOCK\"\n\n    @advertisement\n    @sf_function_test\n    Scenario: Verify advertising the vehicle\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"ADVERTISEMENT\" in \"VEHICLE_CARD\"\n        Then user should be redirected to \"ADVERTISEMENT_PAGE\"\n        When user uploads images to advertisement\n        Then no error toasts should be displayed\n        When user completes adding info specs for advertisement\n        When user selects a price for advertisement\n        Then user publishes the advertisement\n        Then no error toasts should be displayed\n\n    @sf_function_test\n    Scenario: Verify completing function test\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"FUNCTION_TEST_BUTTON\" in \"VEHICLE_CARD\"\n        When user clicks on \"MODAL_START_TEST_BUTTON\" in \"FUNCTION_TEST\"\n        Then user should be redirected to \"FUNCTION_TEST_PAGE\"\n        When user marks faults in function test page\n        When user generates faults page url\n        When user completes function test in sales flow\n        Then partially completed status label should be displayed in function test\n\n    @sf_function_test\n    Scenario: Verify opening faults page url\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"FUNCTION_TEST_BUTTON\" in \"VEHICLE_CARD\"\n        Then user should be redirected to \"FUNCTION_TEST_PAGE\"\n        When user navigates to faults page url \n        When user switches to the new tab   \n        Then user should be redirected to \"SALES_FLOW_FUNCTION_TEST_REPORT_URL\" \n\n    @reserve_from_stock_validation\n    Scenario: Verify adding items to faults reasons in Edit Fault\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"EDIT_FAULTS_BUTTON\" in \"VEHICLE_CARD\"\n        When user switches to the new tab\n        Then user should be redirected to \"EDIT_FAULTS_PAGE\"\n        When user adds items to fault reason \"1\"\n        When user gets item no \"1\" details from the edit faults grid\n\n    @reserve_from_stock_validation\n    Scenario: Verify inventory before reserving from stock\n        Given user is in home page\n        When user expands \"Inventory management\" dropdown in sidebar\n        When user clicks \"All\" in sidebar menu\n        Then user should be redirected to \"INVENTORY_MANAGEMENT_PAGE\"\n        When user gets item \"1\" data from inventory management\n        Then Available quantity amounts should be equal to item \"1\" available quantity\n\n    @reserve_from_stock_validation\n    Scenario: Verify reserving items from stock for validation\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"EDIT_FAULTS_BUTTON\" in \"VEHICLE_CARD\"\n        When user switches to the new tab\n        Then user should be redirected to \"EDIT_FAULTS_PAGE\"\n        When user reserves items from stock\n        When user gets item no \"1\" details from the edit faults grid\n\n    @reserve_from_stock_validation\n    Scenario: Verify inventory after reserving from stock\n        Given user is in home page\n        When user expands \"Inventory management\" dropdown in sidebar\n        When user clicks \"All\" in sidebar menu\n        Then user should be redirected to \"INVENTORY_MANAGEMENT_PAGE\"\n        When user searches item \"1\" data in inventory management after reserving\n        Then reserved amount should be deducted from available quantity in inventory\n        Then total in stock quantity should not be changed in inventory\n        Then reserved amount should be added to reserved from stock quantity\n        Then user gets item \"1\" data from inventory management\n\n    @reserve_from_stock_validation\n    Scenario: Verify deleting added item in Edit Fault\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"EDIT_FAULTS_BUTTON\" in \"VEHICLE_CARD\"\n        When user switches to the new tab\n        Then user should be redirected to \"EDIT_FAULTS_PAGE\"\n        When user gets item no \"1\" details from the edit faults grid\n        When user deletes item no \"1\" from edit faults\n        Then no error toasts should be displayed\n\n    @reserve_from_stock_validation\n    Scenario: Verify inventory after deleting reserved item from Edit Fault\n        Given user is in home page\n        When user expands \"Inventory management\" dropdown in sidebar\n        When user clicks \"All\" in sidebar menu\n        Then user should be redirected to \"INVENTORY_MANAGEMENT_PAGE\"\n        When user searches item \"1\" data in inventory management after reserving\n        Then reserved amount should be added to available quantity in inventory\n        Then total in stock quantity should not be changed in inventory\n        Then reserved amount should be deducted from reserved from stock quantity in inventory\n\n\n    # =================================================================================================> order and receive validation\n\n    @order_receive_validation\n    Scenario: Verify adding item \"2\" to faults reasons in Edit Fault\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"EDIT_FAULTS_BUTTON\" in \"VEHICLE_CARD\"\n        When user switches to the new tab\n        Then user should be redirected to \"EDIT_FAULTS_PAGE\"\n        When user adds items to fault reason \"2\"\n        When user gets item no \"2\" details from the edit faults grid\n\n    @order_receive_validation\n    Scenario: Verify ordering items to stock\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"EDIT_FAULTS_BUTTON\" in \"VEHICLE_CARD\"\n        When user switches to the new tab\n        Then user should be redirected to \"EDIT_FAULTS_PAGE\"\n        When user orders items to stock\n        When user gets item no \"2\" ordered details from the edit faults grid\n\n    @order_receive_validation\n    Scenario: Verify inventory before order receives to stock\n        Given user is in home page\n        When user expands \"Inventory management\" dropdown in sidebar\n        When user clicks \"All\" in sidebar menu\n        Then user should be redirected to \"INVENTORY_MANAGEMENT_PAGE\"\n        When user gets item \"2\" data from inventory management\n        Then no error toasts should be displayed\n\n    @order_receive_validation\n    Scenario: Verify receiving items to stock\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"WORKSHOP_REPAIR_BUTTON\" in \"VEHICLE_CARD\"\n        Then user should be redirected to \"WORKSHOP_REPAIR_OVERVIEW_PAGE\"\n        When user clicks on \"VIEW_BUTTON\" in \"WORKSHOP_REPAIR_OVERVIEW\"\n        When user switches to the new tab\n        When user clicks on \"START_REPAIR_BUTTON_IN_MODAL\" in \"WORKSHOP_REPAIR\"\n        Then user should be redirected to \"WORKSHOP_REPAIR_PAGE\"\n        When user clicks on \"ORDERED_NOT_RECEIVED_BUTTON\" in \"WORKSHOP_REPAIR\"\n        When user switches to the new tab\n        Then user should be redirected to \"ORDERED_NOT_RECEIVED\"\n        When user receives the ordered quantity\n        Then no error toasts should be displayed\n\n    @order_receive_validation\n    Scenario: Verify inventory after receiving from stock\n        Given user is in home page\n        When user expands \"Inventory management\" dropdown in sidebar\n        When user clicks \"All\" in sidebar menu\n        Then user should be redirected to \"INVENTORY_MANAGEMENT_PAGE\"\n        When user searches item \"2\" data in inventory management after reserving\n        Then reserved amount should be added to reserved from stock quantity\n        Then reserved amount should be added to total in stock quantity\n\n    @order_receive_validation\n    Scenario: Verify reserving items from stock\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"EDIT_FAULTS_BUTTON\" in \"VEHICLE_CARD\"\n        When user switches to the new tab\n        Then user should be redirected to \"EDIT_FAULTS_PAGE\"\n        When user adds items to fault reason \"1\"\n        When user gets item no \"1\" details from the edit faults grid\n        When user reserves items from stock\n        Then no error toasts should be displayed\n\n    @pickup_reserved_validation\n    Scenario: Verify getting data in workshop repair before picking up\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"WORKSHOP_REPAIR_BUTTON\" in \"VEHICLE_CARD\"\n        Then user should be redirected to \"WORKSHOP_REPAIR_OVERVIEW_PAGE\"\n        When user clicks on \"OPEN_WORKSHOP_BUTTON\" in \"WORKSHOP_REPAIR_OVERVIEW\"\n        When user switches to the new tab\n        Then user should be redirected to \"WORKSHOP_REPAIR_PAGE\"\n        When user gets item \"1\" data from workshop repair\n\n    @pickup_reserved_validation\n    Scenario: Verify inventory before picking up\n        Given user is in home page\n        When user expands \"Inventory management\" dropdown in sidebar\n        When user clicks \"All\" in sidebar menu\n        Then user should be redirected to \"INVENTORY_MANAGEMENT_PAGE\"\n        When user gets item \"1\" data from inventory management\n        Then no error toasts should be displayed\n\n\n    @pickup_reserved_validation\n    Scenario: Verify picking up item \"1\" in workshop repair\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"WORKSHOP_REPAIR_BUTTON\" in \"VEHICLE_CARD\"\n        Then user should be redirected to \"WORKSHOP_REPAIR_OVERVIEW_PAGE\"\n        When user clicks on \"OPEN_WORKSHOP_BUTTON\" in \"WORKSHOP_REPAIR_OVERVIEW\"\n        When user switches to the new tab\n        Then user should be redirected to \"WORKSHOP_REPAIR_PAGE\"\n        When user picks up from item \"1\" in workshop repair\n\n    @pickup_reserved_validation\n    Scenario: Verify inventory after picking up in workshop repair\n        Given user is in home page\n        When user expands \"Inventory management\" dropdown in sidebar\n        When user clicks \"All\" in sidebar menu\n        Then user should be redirected to \"INVENTORY_MANAGEMENT_PAGE\"\n        When user searches item \"1\" data in inventory management after reserving\n        Then picked up quantity should be deducted from reserved from stock quantity\n        Then picked up quantity should be deducted from total in stock quantity\n        When user gets item \"1\" data from inventory management\n\n    @restocked_reserved_validation\n    Scenario: Verify restocking item \"1\" in workshop repair\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"WORKSHOP_REPAIR_BUTTON\" in \"VEHICLE_CARD\"\n        Then user should be redirected to \"WORKSHOP_REPAIR_OVERVIEW_PAGE\"\n        When user clicks on \"OPEN_WORKSHOP_BUTTON\" in \"WORKSHOP_REPAIR_OVERVIEW\"\n        When user switches to the new tab\n        Then user should be redirected to \"WORKSHOP_REPAIR_PAGE\"\n        When user restocks from item \"1\" in workshop repair\n\n    @restocked_reserved_validation\n    Scenario: Verify inventory after restocking item \"1\" in workshop repair\n        Given user is in home page\n        When user expands \"Inventory management\" dropdown in sidebar\n        When user clicks \"All\" in sidebar menu\n        Then user should be redirected to \"INVENTORY_MANAGEMENT_PAGE\"\n        When user searches item \"1\" data in inventory management after reserving\n        Then restocked quantity should be deducted from reserved from stock quantity\n        Then total in stock quantity should not be changed in inventory\n        Then restocked quantity should be added to available quantity\n        When user gets item \"1\" data from inventory management\n\n\n    # =================================================================================================> received validation\n\n    @pickup_reserved_validation\n    Scenario: Verify getting data in workshop repair before picking up from recieved items\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"WORKSHOP_REPAIR_BUTTON\" in \"VEHICLE_CARD\"\n        Then user should be redirected to \"WORKSHOP_REPAIR_OVERVIEW_PAGE\"\n        When user clicks on \"OPEN_WORKSHOP_BUTTON\" in \"WORKSHOP_REPAIR_OVERVIEW\"\n        When user switches to the new tab\n        Then user should be redirected to \"WORKSHOP_REPAIR_PAGE\"\n        When user gets item \"2\" data from workshop repair\n\n    @pickup_recieved_validation\n    Scenario: Verify inventory before picking up from recieved items from recieved items\n        Given user is in home page\n        When user expands \"Inventory management\" dropdown in sidebar\n        When user clicks \"All\" in sidebar menu\n        Then user should be redirected to \"INVENTORY_MANAGEMENT_PAGE\"\n        When user gets item \"2\" data from inventory management\n        Then no error toasts should be displayed\n\n\n    @pickup_recieved_validation\n    Scenario: Verify picking up item \"2\" in workshop repair from recieved items\n        Given user searches a sales lead id in quick search\n        When user clicks on \"SHOW_VEHICLE_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"VEHICLE_CARD_PAGE\"\n        When user clicks on \"WORKSHOP_REPAIR_BUTTON\" in \"VEHICLE_CARD\"\n        Then user should be redirected to \"WORKSHOP_REPAIR_OVERVIEW_PAGE\"\n        When user clicks on \"OPEN_WORKSHOP_BUTTON\" in \"WORKSHOP_REPAIR_OVERVIEW\"\n        When user switches to the new tab\n        Then user should be redirected to \"WORKSHOP_REPAIR_PAGE\"\n        When user picks up from item \"2\" in workshop repair\n\n    @pickup_recieved_validation\n    Scenario: Verify inventory after picking up in workshop repair from recieved items\n        Given user is in home page\n        When user expands \"Inventory management\" dropdown in sidebar\n        When user clicks \"All\" in sidebar menu\n        Then user should be redirected to \"INVENTORY_MANAGEMENT_PAGE\"\n        When user searches item \"2\" data in inventory management after reserving\n        Then picked up quantity should be deducted from reserved from stock quantity\n        Then picked up quantity should be deducted from total in stock quantity\n        When user gets item \"2\" data from inventory management\n\n    @restocked_recieved_validation\n    Scenario: Verify restocking item \"2\" in workshop repair from recieved items\n        Given user searches a sales lead id in quick search\n        When u RKSHOP_LEAD_PAGE\"\n        When user books the workshop for the vehicle\n        Then no error toasts should be displayed\n\n    Scenario: Verify checking the vehicle in\n        Given user searches a service lead id in quick search\n        When user clicks on \"SHOW_WORKSHOP_CARD_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"WORKSHOP_CARD_PAGE\"\n        When user clicks on \"CHECK_IN_BUTTON\" in \"WORKSHOP_CARD\"\n        Then user should be redirected to \"WORKSHOP_CHECK_IN_PAGE\"\n        Then user checks the vehicle in\n\n    # ================================================================================> reserve from stock related validations\n\n    @reserve_from_stock_validation_sf\n    Scenario: Verify adding items to faults reasons in Edit Fault\n        Given user searches a service lead id in quick search\n        When user clicks on \"SHOW_WORKSHOP_CARD_BUTTON\" in \"QUICK_SEARCH\"\n        Then user should be redirected to \"WORKSHOP_CARD_PAGE\"\n        When user clicks on \"EDIT_FAULTS_BUTTON\" in \"VEHICLE_CARD\"\n        When user switches to the new tab\n        Then user should be redirected to \"EDIT_FAULTS_PAGE\"\n        When user adds items to fault reason \"1\"\n        When user gets item no \"1\" details from the edit faults grid\n\n    @reserve_from_stock_validation_sf\n    Scenario: Verify inventory before reserving from stock\n        Given user is in home page\n        When user expands \"Inventory management\" dropdown in sidebar\n        When user clicks \"All\" in sidebar menu\n        Then user should be redirected to \"INVENTORY_MANAGEMENT_PAGE\"\n        When user gets item \"1\" data from inventory management\n        Then Available quantity amounts should be equal to item \"1\" available quantity\n\n    @reserve_from_stock_validation_sf\n    Scenario: Verify reserving items from stock for validation\n        Given user searches a service lead id in quick search\n        When user clicks on \"SHOW <style>
pre:has([data-custom-html]) {
  padding-left: 0.75em !important;
}
pre:has([data-custom-html])::before {
  content: none !important;
}
</style>


<style>
a.view-trace {
  text-decoration: none; 
  color: #297bde;
}

a.view-trace:hover {
  text-decoration: underline;
}
</style>
<script>
function updateTraceViewLink(link) {
  if (!isHttpUrl(window.location.href)) return;
  var urlObj = new URL(link.href);
  var traceUrl = urlObj.searchParams.get('trace') || '';
  if (!isHttpUrl(traceUrl)) {
    traceUrl = new URL(traceUrl, window.location.href).href;
    urlObj.searchParams.set('trace', traceUrl);
    link.href = urlObj.href;
  }
}
function isHttpUrl(url) {
  return url.startsWith('http://') || url.startsWith('https://');
} 
</script>


<script>
function copyPrompt(button, prompt) {
  var originalText = button.textContent;
  if (originalText === 'Copied') return;
  navigator.clipboard.writeText(prompt).then(() => {
    button.textContent = 'Copied';
    setTimeout(() => button.textContent = originalText, 2000);
  });
}
</script>
</body>
</html>
